import React,{Router,Component} from 'react';
import './fonts/DMMono-Regular.ttf';
import { FaGithub, FaEnvelope, FaLinkedin, FaSeedling } from 'react-icons/fa';
import './App.css';
import Sidebar from './components/sidebars';


class App extends Component {
	render() {
		return (
			    <div >
			    	<div class="homepage">
	      				<header class="App-header">
	      					<div class="name" > <b> ISHITA KORDE </b> </div>
	      					<div class="circle"> </div>
		        		</header>

		        		<div class = "sidebar-bkgd">
			       	 		<p class="sidebar"> <b> about  </b> </p>
			       	 		<p class="sidebar"> <b> resume  </b> </p>
			       	 		<br />
			       	 		<p class="sidebar"> <b> <FaGithub size="1.4em"/>  </b> </p>
			       	 		<p class="sidebar"> <b> <FaEnvelope size="1.3em"/>  </b> </p>
			       	 		<p class="sidebar"> <b> <FaLinkedin size="1.4em"/>  </b> </p>
		       	 		</div>

		       	 		<div class= "about">
		       	 			<div class="title"><b> hi, </b></div>
		       	 			<div class="list"> I'm a Computer Science graduate with an interest in developing technology to take care of planet earth. 
		       	 			<br />
		       	 			<br />
		       	 			I believe technology is crucial in moving the world towards sustainable practices and reducing carbon emissions. </div>
		       	 			<br />
		       	 			<div class="title"> CURRENT PROJECTS</div>
		       	 			<div class="list"> <FaSeedling size="0.7em" color='#689791'/> Computer Vision Nanodegree via Udacity</div>
		       	 			<div class="list"> <FaSeedling size="0.7em" color='#689791'/> Building raised beds for our home garden</div>
		       	 			<div class="list"> <FaSeedling size="0.7em" color='#689791'/> Attempting handstands </div>

		       	 			<br />
		       	 			<div class="title"> PAST EXPERIENCE </div>
		       	 			<div class="list"> Software Developer Intern @ <b style={{color:"orange"}}> <Route path='/privacy-policy' component={() => { 
     window.location.href = 'https://www.ipac.caltech.edu/'; 
     return null;
}}/>Caltech IPAC </b> </div>
		       	 			<div class="list"> Software Optimization Intern @ <b style={{color:"red"}}>NASA Jet Propulsion Laboratory </b> </div>
		       	 			<div class="list">  Researcher @ <b>Riverside Lab for Artificial Intelligence Research </b></div>
		       	 			<div class="list"> Researcher @ <b> UCR Handwriting Recognition Lab </b> </div>
		       	 			<div class="list"> Python Tutor @ <b style={{color:"blue"}}> CodeConnects </b></div>

		       	 			<br />
		       	 			<div class="title"> PROJECTS </div>
		       	 			<div class="list"> <b>  </b> </div>

		       	 		</div>
	       	 		</div>


      			</div>

		)
	}
}

export default App;
